Better options available nearby'}, {'Review_Rating': '4.4', 'Review_Heading': 'Airport Hotel Grand”', 'Review_Body': 'The Hotel lacks maintenance. Being a solo traveler the initial room  allocated was full of dust & smelly. They gave 2 more options but other 2 were also the same. Somehow one of them was ok to stay for a night but still asked the hotel to change the pillow cover. Moreover the room picture on the website does not matches with the actuals. Agoda showed verify this by itself before adding the pictures.'}, {'Review_Rating': '2.0', 'Review_Heading': 'Worst services ”', 'Review_Body': "Called agoda customer service regarding problems in hotel and was promised a call back but didn't got any call yet. Has to checkout next day and stayed at another property. Arogent staff, not even a single professional staff available all local people. Worst then anything.  Not hot water available all electric sockets are openly hanging. "}, {'Review_Rating': '2.0', 'Review_Heading': 'Acceptable”', 'Review_Body': 'Not at all recommended. The service is extremely poor. Not even a proper wifi connection. Bed roll soiled and when asked about it so the receptionist says you should have checked it when you checked the room. '}, {'Review_Rating': '2.8', 'Review_Heading': 'Not what appears in photo”', 'Review_Body': 'When trying to check in, hotel staff asked that I cancel my prepaid booking with Agoda. He said it made a mistake excuse. After I insisted for the room he provided a very bad condition room; moldy wall, dirty floor, stained bedsheet, clog wash sink and overall a very dirty room.'}, {'Review_Rating': '4.0', 'Review_Heading': 'Acceptable”', 'Review_Body': 'Gfff'}, {'Review_Rating': '7.2', 'Review_Heading': 'Very good”', 'Review_Body': 'Value for money, can become better in terms of cleanliness'}, {'Review_Rating': '2.0', 'Review_Heading': 'Acceptable”', 'Review_Body': 'Poor service '}, {'Review_Rating': '2.0', 'Review_Heading': 'Cancelled last minute”', 'Review_Body': 'This hotel cancelled my stay last minute under the guise of a covid case. I had to find a different hotel last minute which meant I had to pay double just to secure something while tired. On top of this, they are yet to refund me. NEVER book this hotel they are dodgy.'}, {'Review_Rating': '2.0', 'Review_Heading': 'Acceptable”', 'Review_Body': 'Worst hotel ever'}, {'Review_Rating': '2.0', 'Review_Heading': 'Very Bad experience ”', 'Review_Body': "No hot wolater, no tv, no breakfast. Hotel is not maintained and not worth the value it charges. I doesn't feel safe in hotel. Not recommended. "}, {'Review_Rating': '2.8', 'Review_Heading': 'Acceptable”', 'Review_Body': 'Poorly maintained  stinky rooms and lobby. Washroom pathetic.. lights dim... assurance for hot water in morning hrs... no tea kettle... no vents.. Tv sets hanging without cable..rest you can imagine.. Agoda pics totally deceptive and morphed..
hope things may improve in future... Good luck..'}, {'Review_Rating': '2.0', 'Review_Heading': 'AVOID”', 'Review_Body': 'Totally rip off. Avoid this place'}, {'Review_Rating': '10.0', 'Review_Heading': 'Exceptional”', 'Review_Body': 'Best stay..'}], 'price': '1,607', 'img_link': 'https://pix8.agoda.net/hotelImages/1165982/-1/dbf238dc8e553ba3941d9492fae761ca.jpg?ca=16&ce=1&s=1024x768', 'room_size': '22m²', 'amenities': ['City view', 'Balcony/terrace', 'Non-smoking', 'Shower', 'Kitchenette', 'Free Wi-Fi', 'Accessible vanities', 'Roll-in shower', 'Adapted bath', 'Bathrobes', 'Hair dryer', 'Mirror', 'Shower chair', 'Toiletries', 'Towels', 'Walk-in shower', 'Books/DVDs/music for children', 'Free Wi-Fi in all rooms!', 'Satellite/cable channels', 'Streaming service like Netflix', 'Telephone', 'Adapter', 'Air conditioning', 'Alarm clock', 'Blackout curtains', 'Daily newspaper', 'Fan', 'Hand sanitizer', 'Heating', 'Linens', 'Sleep comfort items', 'Slippers', 'Soundproofing', 'Wake-up service', 'Alcohol', 'BBQ facilities', 'Coffee/tea maker', 'Dishwasher', 'Free bottled water', 'Fruits/snacks', 'Mini bar', 'Refrigerator', 'Wine glasses', 'Daily housekeeping', 'Desk', 'Laptop workspace', 'Outdoor furniture', 'Seating area', 'Separate dining area', 'Sofa', 'Tile/marble flooring', 'Trash cans', 'Wooden/parqueted flooring', 'Closet', 'Clothes rack', 'Dressing room', 'Ironing facilities', 'Trouser press', 'Accessible by elevator', 'Baby safety gates', 'Fire extinguisher', 'Individual air conditioning', 'In-room safe box', 'Laptop safe box', 'Locker', 'Safety/security feature', 'Smoke detector'], 'city': 'Delhi NCR', 'link': 'https://agoda.com/en-gb/airport-hotel-grand/hotel/new-delhi-and-ncr-in.html?finalPriceView=1&isShowMobileAppPrice=false&cid=-999&numberOfBedrooms=&familyMode=false&adults=2&children=0&rooms=1&maxRooms=0&checkIn=2023-03-18&isCalendarCallout=false&childAges=&numberOfGuest=0&missingChildAges=false&travellerType=1&showReviewSubmissionEntry=false&currencyCode=INR&i